import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

export default new VueRouter({
    routes: [
        {
            path : '/order',//访问路径
            name : 'home',
            component: () => import('@/components/HelloWorld') //对应组件
        },

    ],
    mode: "history" //去除访问时候带#问题
})
